import React, { Component } from "react";
class Head extends Component {
  state = {
    logo: "https://imgur.com/gpvVWGa.jpg"
  };
  render() {
    return (
      <div>
        <Text style={{ textAlign: "right" }}>Hello, World!</Text>
        <img src={this.state.logo} alt="Mango" />;
      </div>
    );
  }
}

export default Head;
